/N[`<?php exit; ?>a:1:{s:7:"content";O:8:"stdClass":10:{s:7:"term_id";s:2:"62";s:4:"name";s:12:"جودادي";s:4:"slug";s:36:"%d8%ac%d9%88%d8%af%d8%a7%d8%af%d9%8a";s:10:"term_group";s:1:"0";s:10:"term_order";s:1:"0";s:16:"term_taxonomy_id";s:2:"62";s:8:"taxonomy";s:6:"stores";s:11:"description";s:1095:"<b>جودادي</b> أو GoDaddy هو ويب مجال استضافة دومينات(نطاقات) المواقع في الانترنت الشركة التي تبيع أيضا الأعمال الإلكترونية البرمجيات والخدمات ذات الصلة. في عام 2010، وصلت إلى أسماء النطاقات أكثر من 45 مليون تحت إدارة. GoDaddy أو هي حاليا أكبر شركة في ICANN المعتمدين المسجل في العالم، وأربعة أضعاف حجم أقرب منافسيها.

بدأت GoDaddy أو الإعلان في السوبر بول في عام 2005. ومنذ ذلك الحين، توسعت الشركة لتشمل تسويق الرعايات الرياضية وأكد GoDaddy أو GoDaddy أو رفعها لطرح عام أولي في عام 2006، ولكنها ألغت في وقت لاحق، وذلك بسبب "عدم اليقين في السوق" في عام 2011، أن KKR، سيلفر ليك بارتنرز والمشاريع كروس التكنولوجيا قد أغلقت صفقة الأسهم الخاصة.";s:6:"parent";s:1:"0";s:5:"count";s:1:"0";}}